import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route, HashRouter} from "react-router-dom";
import './index.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import UserForm from "./components/UserForm";
import Home from "./components/Home";
import Login from "./components/Login"
import RegistrationPage from "./components/registrationPagee";
import MyProfile from "./components/MyProfile";
import BmiPage from "./components/BmiPage"
import BmiDetail from "./components/BmiDetail"
import LinearChart from "./components/LinearChart"
import Display from "./components/Chart"




class RouterNavigationSample extends React.Component {
  render() {
    return (
      <Router>
      <div className="container">
        <>
          <Route exact path="/" render={props => <LinearChart {...props} />}/>   
          <Route path = "/BmiDetail" render = {props => <BmiDetail {...props} />} />
          <Route path = "/Login" render = {props => <Login {...props} />} />
          <Route path = "/register" render = {props => <RegistrationPage {...props} />} />
          <Route path = "/BmiPage" render = {props => <BmiPage {...props} />} />
        </>
        </div>
      </Router>
    );
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<RouterNavigationSample />, rootElement);
